import React from 'react';
import { BrowserRouter as Router, Route, Switch, useLocation } from 'react-router-dom';
import './App.css';
import Header from './Header';
import Home from './Home';
import Store from './Store';
import Info from './Info';
import Product from './Products/Product.js'

function App(props) {
  // let location = useLocation();
  const { title } = props.location.title;

  console.log(title);
  return (
    <Router>
      <div className="app">
          <Switch>
            <Route path='/product'>
              <Header/>
              <Product 
              // id={location.id}
              // image={location.image}
              // title={location.title}
              // price={location.price}
              />
            </Route>
            <Route path='/store/frames'>
              <Header/>
              <Store items='Frames'/>
              <Info />
            </Route>
            <Route path='/store/hiveComponents'>
              <Header/>
              <Store items='HiveComponents'/>
              <Info />
            </Route>
            <Route path='/store/beeHiveKits'>
              <Header/>
              <Store items='BeeHiveKits'/>
              <Info />
            </Route>
            <Route path='/store/bargainBarnItems'>
              <Header/>
              <Store items='BargainBarnItems'/>
              <Info />
            </Route>
            <Route path='/store/nucBoxesSupplies'>
              <Header/>
              <Store items='NucBoxesSupplies'/>
              <Info />
            </Route>
            <Route path='/'>
              <Header />
              <Home />
              <Info />
            </Route>

          </Switch>
      </div>
    </Router>
  );
}

export default App;
